                $.alerts.verticalOffset = options.verticalOffset || $.alerts.verticalOffset;
                $.alerts.horizontalOffset = options.horizontalOffset || $.alerts.horizontalOffset;
                $.alerts.repositionOnResize = options.repositionOnResize || $.alerts.repositionOnResize;
                $.alerts.overlayOpacity = options.overlayOpacity || $.alerts.overlayOpacity;
